    <Row >
      <Col xl={11} lg={11} md={11} >
        <div className="menuAndHamburger">
          <Menu />
          <HamburgerMenu />
        </div>
      </Col>
    </Row>
    <Row justify="end" style={{ height: "70px" }}>
      <Col
        xl={2.5}
        offset={{ xl: 8, lg: 8, md: 8, sm: 8, xs: 8 }}
        lg={2.5}
        md={2.5}
        sm={2.5}
        xs={2.5}
      >
        <ArrowRight />
      </Col>
    </Row>
  </div>
    )
  }
}
